import React, { useEffect, useState } from 'react';

function WellnessReport() {
  const [data, setData] = useState([]);
  const [dailyAverages, setDailyAverages] = useState([]);
  const [rollingAverages, setRollingAverages] = useState([]);
  const [selectedMetric, setSelectedMetric] = useState('sleep');
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const sheetUrl = "https://opensheet.elk.sh/1x1e53gsx3VzEJ5ON5QOvYeJTGI8auMtSxJYYpUUmreY/Wallnes";

  useEffect(() => {
    fetch(sheetUrl)
      .then(res => res.json())
      .then(json => {
        const sorted = [...json].sort((a, b) => new Date(a.Timestamp) - new Date(b.Timestamp));
        setData(sorted);

        const groupedByDate = {};
        sorted.forEach(entry => {
          const date = new Date(entry.Timestamp).toISOString().split('T')[0];
          if (!groupedByDate[date]) groupedByDate[date] = [];
          groupedByDate[date].push(entry);
        });

        const daily = Object.entries(groupedByDate).map(([date, entries]) => {
          const sleep = avg(entries.map(e => Number(e["What is the quality of your sleep at night?"])));
          const sore = avg(entries.map(e => Number(e["How sore are you?"])));
          const fatigue = avg(entries.map(e => Number(e["How Fatigued are you?"])));
          return { date, sleep, sore, fatigue };
        });
        setDailyAverages(daily.slice(-5));

        const rolling = [];
        for (let i = 1; i <= 10; i++) {
          const recent = daily.slice(-i);
          rolling.push({
            days: i,
            sleep: avg(recent.map(d => d.sleep)),
            sore: avg(recent.map(d => d.sore)),
            fatigue: avg(recent.map(d => d.fatigue))
          });
        }
        setRollingAverages(rolling);
      });
  }, []);

  const avg = arr => arr.length ? (arr.reduce((a, b) => a + b, 0) / arr.length).toFixed(2) : '-';

  const handleFilter = () => {
    const filtered = data.filter(entry => {
      const d = new Date(entry.Timestamp);
      return (!startDate || new Date(startDate) <= d) && (!endDate || d <= new Date(endDate));
    });
    const grouped = {};
    filtered.forEach(entry => {
      const name = entry["Name"];
      const val = Number(entry[getMetricLabel(selectedMetric)]);
      if (!grouped[name]) grouped[name] = [];
      grouped[name].push(val);
    });
    const result = Object.entries(grouped).map(([name, vals]) => ({
      name,
      value: avg(vals)
    }));
    return result;
  };

  const getMetricLabel = (metric) => {
    switch (metric) {
      case 'sleep': return "What is the quality of your sleep at night?";
      case 'sore': return "How sore are you?";
      case 'fatigue': return "How Fatigued are you?";
      default: return '';
    }
  };

  return (
    <div className="wellness-report" dir="rtl" style={{ padding: '20px' }}>
      <h1>דוח Wellness</h1>

      <h2>ממוצע קבוצתי לפי תאריכים אחרונים</h2>
      <table border="1" cellPadding="8">
        <thead>
          <tr>
            <th>תאריך</th>
            <th>שינה 💤</th>
            <th>עייפות 😴</th>
            <th>כאבים 💪</th>
          </tr>
        </thead>
        <tbody>
          {dailyAverages.map((day, i) => (
            <tr key={i}>
              <td>{day.date}</td>
              <td>{day.sleep}</td>
              <td>{day.fatigue}</td>
              <td>{day.sore}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <h2>ממוצעים קבוצתיים מתגלגלים</h2>
      <table border="1" cellPadding="8">
        <thead>
          <tr>
            <th>ימים אחרונים</th>
            <th>שינה 💤</th>
            <th>עייפות 😴</th>
            <th>כאבים 💪</th>
          </tr>
        </thead>
        <tbody>
          {rollingAverages.map((item, i) => (
            <tr key={i}>
              <td>{item.days}</td>
              <td>{item.sleep}</td>
              <td>{item.fatigue}</td>
              <td>{item.sore}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <h2>חשב ממוצע לפי טווח תאריכים</h2>
      <div>
        <label>משתנה:</label>
        <select value={selectedMetric} onChange={e => setSelectedMetric(e.target.value)}>
          <option value="sleep">שינה</option>
          <option value="fatigue">עייפות</option>
          <option value="sore">כאבים</option>
        </select>
        <label>מתאריך:</label>
        <input type="date" value={startDate} onChange={e => setStartDate(e.target.value)} />
        <label>עד תאריך:</label>
        <input type="date" value={endDate} onChange={e => setEndDate(e.target.value)} />
      </div>

      <h3>תוצאות ממוצעים לפי טווח תאריכים</h3>
      <table border="1" cellPadding="8">
        <thead>
          <tr>
            <th>שחקנית</th>
            <th>ממוצע</th>
          </tr>
        </thead>
        <tbody>
          {handleFilter().map((item, i) => (
            <tr key={i}>
              <td>{item.name}</td>
              <td>{item.value}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default WellnessReport;
